import React from 'react';
import amber from '@material-ui/core/colors/amber';
import lime from '@material-ui/core/colors/lime';
import Card from '@material-ui/core/Card';
import CardActions from "@material-ui/core/CardActions";
import CardHeader from "@material-ui/core/CardHeader";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";
import Grid from "@material-ui/core/Grid";
import makeStyles from "@material-ui/core/styles/makeStyles";
import {FlippingCard, FlippingCardBack, FlippingCardFront} from 'react-ui-cards'

const DP_width = 482;
const DP_height = DP_width;

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1
    },
    card: {
        minHeight: 30,
        height: 600,//400,
        background: 'linear-gradient(45deg, #FFECB3, #FFE082)' //amber[100]
    },
    link_bar: {
        //minWidth: 700,
        backgroundColor: amber[300],
        minHeight: 40,
        height: 40
    },
    media: {
        minWidth: DP_width,
        width: DP_width,
        minHeight: DP_height,
        height: DP_height,
    },
}))

export default function HobbiesPage() {
    const classes = useStyles();
    return (
        <Grid container justify="space-evenly" spacing={6}>
            {[...Array(6)].map((a, b) =>
                <Grid item xs={4}>
                    <Card raised className={classes.card}>
                        <CardHeader title={"SpeedCubing"}/>
                        <CardMedia className={classes.media}
                                   title="SpeedCubing"
                                   image={require("../images/Cubing/Cubing_DP.jpg")}
                        />
                        <CardContent>
                            Hello
                        </CardContent>

                    </Card>
                    <Card raised className={classes.link_bar}>
                        <CardContent>
                            Tags
                        </CardContent>
                    </Card>
                </Grid>
            )}
        </Grid>
    );
}
